const { Turtle, noise } = art;

const t = new Turtle();

let maxI = 493;
for (let j = 0; j < +23; j++) {
  for (let i = 0; i < maxI; i++) {
    if (i == 0) t.up();
    else t.down();
    let x = i/12;
    let y = Math.sin(x)*1/5
      + j*0.61 
      + noise((i*0.014)+(j*51))*3.0 
      // + noise(i*1/145) 
      // + noise(j*54)*14; 
    
    t.goTo(x, y);
    
    if (i === maxI -1) {
      t.setAngle(-90);
      t.forward(7);
  
      const first = t.path.at(1).at(0);
      const last = t.path.at(-1).at(-1);
      t.goTo(first.x, last.y);
      t.goTo(first.x, first.y);
    }
  }
}

t.scale(0.1)

const extrema = t.extrema();
t.translate(
  0,
  0,
  [ 
    (extrema.xMin+extrema.xMax)/2, 
    (extrema.yMin+extrema.yMax)/2,
  ]
)

t.applyPts(pt => [pt.x, pt.y]);

const final = [t.path[0]];

